import React from 'react';
import './css/inicio.css';
import MyImage from '../src/public/images/img1.png';
import BusImage from '../src/public/images/bus.png';
import TecsupImage from '../src/public/images/tecsup.png';

function Inicio() {
  return (
    <div className='inicio'>
      <div className='image'>
        <img src={MyImage} alt="login" className='fixed-image' />
      </div>
      <div className='content'>
        <div className='top-bar'>TECSUP</div>
        <div className='side-rectangle'>
          <div className="text-container">
            <p className='text'>BusTecsup / Registro</p>
            <img src={BusImage} alt="bus" className="bus-image" />
            <img src={TecsupImage} alt="tecsup" className="tecsup-image" />
          </div>
          <label htmlFor='input1'>Correo</label>
          <input type='text' id='input1' placeholder='user.lastname@tecsup.edu.pe' />

          <label htmlFor='input2'>Contraseña</label>
          <input type='text' id='input2' placeholder='Input 2' />

          <a href='tu-url-aqui'>¿Has olvidado la contraseña?</a>

          <button className='btn btn-primary btn-lg btn-block'>Iniciar Sesión</button><br />
          <button className='btn btn-primary btn-lg btn-block'>Google</button><br />
        </div>
      </div>
    </div>
  );
}

export default Inicio;
